package core;

import java.util.TreeMap;

public class PractiseTreeMap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TreeMap tm = new TreeMap<Integer,String>();
		tm.put(10, "ab");
		tm.put(2, "adsab");
		tm.put(5, "aavdsb");
		tm.put(1, "adsvab");
		tm.put(100, "avsd1b");
		System.out.println(tm);
	}

}
